import React from "react";
import Avatar from "./Avatar";

function click(event) {
  console.log(event.target);
}

function Card(props) {
  return (
    <div className=" col-lg-4 col-md-4 col-sm-12">
      <div className="">
        {/* <p>{props.id}</p> */}
        <h6 onClick={click}>
          <strong>{props.name}</strong>
        </h6>
        <Avatar img={props.img} />
      </div>
    </div>
  );
}

export default Card;
